package com.wxws.myticket.bus.entity;import java.io.Serializable;/** * app版本等基本信息 * * @author Administrator */public class VersionInfo implements Serializable{	/**	 * versionCode	string	是	待升级 apk 的versioncode ， 用来和本地做比较	 alertMsg	string	是	弹出内容	 alertTitle	string	是	弹框标题	 downLoadUrl	string	是	下载地址	 isForce	string	是	是否强制更新	 0：否	 1：是	 versionName	string	是	需要升级到的apk name ,本版本是 7.0.3	 */	private String downLoadUrl;	private String isForce;	private int versionCode;	private String alertMsg;	private String alertTitle;	private String versionName;	public String getAlertTitle() {		return alertTitle;	}	public void setAlertTitle(String alertTitle) {		this.alertTitle = alertTitle;	}	public int getVersionCode() {		return versionCode;	}	public void setVersionCode(int versionCode) {		this.versionCode = versionCode;	}	public String getAlertMsg() {		return alertMsg;	}	public void setAlertMsg(String alertMsg) {		this.alertMsg = alertMsg;	}	public String getVersionName() {		return versionName;	}	public void setVersionName(String versionName) {		this.versionName = versionName;	}	public String getDownLoadUrl() {		return downLoadUrl;	}	public void setDownLoadUrl(String downLoadUrl) {		this.downLoadUrl = downLoadUrl;	}	public String getIsForce() {		return isForce;	}	public void setIsForce(String isForce) {		this.isForce = isForce;	}}